import React from "react";
import { Tab } from "./Tab";
import styles from "./Tabs.module.css"

export const Tabs = () => {
  return (
    <div className={styles["tabs__wrap"]}>
      <Tab text={"All"} id="tab0"/>
      <Tab text={"All"} id="tab1"/>
      <Tab text={"All"} id="tab2"/>
    </div>
  );
};
